    const URL = '/onepiece';
    const data = await fetch(URL, {
        headers : { 
          'Content-Type': 'application/json',
          'Accept': 'application/json'
         }
    })
    const dataJSON = await data.json()
    console.log(dataJSON)
  }

  return (
    <div className="App">
      <h1>Hello</h1>
    </div>
  );
}

export default App;
